import React from "react";
import img from "../asset/hero.png";
import { Container, Row, Col, Card, Button } from 'react-bootstrap';


const Home = () => {
  return (
    <>

    <section className="hero-section">
    <Container fluid className="p-0">
      <Row>
        <Col className="p-0">
          <img
            src={img}  
            alt="Hero Image"
            className="img-fluid w-100"
          />
          <col>
          {/* Card at the bottom left corner */}
          <Card className="position-absolute bottom-0 start-0 m-3">
            <Card.Body>
              <Card.Title><h1>We Crush Your <br/>
                Competitors, Goals, And<br/>
                Sales Record - Without<br/>
                The B.S.</h1>
              </Card.Title>
              <Button variant="primary">GET FREE CONSULTATION</Button>
            </Card.Body>
          </Card>
          </col>
        </Col>
      </Row>
    </Container>
  </section>
  </>
  );
};

export default Home;
